tinymce.PluginManager.add("embed_youtube",function(e){function o(){e.windowManager.open({title:"Paste youtube link",width:600,height:400,body:[{name:"url",type:"textbox",size:40,autofocus:!0,label:"Url",onchange:function(){console.log("url changed")},onkeyup:function(){console.log("url keyup")}},{name:"preview",type:"iframe"}]})}e.addButton("embed_youtube",{icon:"media",tooltip:"Add a youtube video",onclick:o,stateSelector:"iframe"})});
